### YamlMime:TSEnum
name: TestOutcome
uid: azure-devops-extension-api.TestOutcome
package: azure-devops-extension-api
summary: Valid TestOutcome values.
fullName: TestOutcome
remarks: ''
isPreview: false
isDeprecated: false
fields:
  - name: Unspecified
    uid: azure-devops-extension-api.TestOutcome.Unspecified
    package: azure-devops-extension-api
    summary: Only used during an update to preserve the existing value.
    numericValue: 0
  - name: None
    uid: azure-devops-extension-api.TestOutcome.None
    package: azure-devops-extension-api
    summary: >-
      Test has not been completed, or the test type does not report
      pass/failure.
    numericValue: 1
  - name: Passed
    uid: azure-devops-extension-api.TestOutcome.Passed
    package: azure-devops-extension-api
    summary: Test was executed w/o any issues.
    numericValue: 2
  - name: Failed
    uid: azure-devops-extension-api.TestOutcome.Failed
    package: azure-devops-extension-api
    summary: >-
      Test was executed, but there were issues. Issues may involve exceptions or
      failed assertions.
    numericValue: 3
  - name: Inconclusive
    uid: azure-devops-extension-api.TestOutcome.Inconclusive
    package: azure-devops-extension-api
    summary: >-
      Test has completed, but we can't say if it passed or failed. May be used
      for aborted tests...
    numericValue: 4
  - name: Timeout
    uid: azure-devops-extension-api.TestOutcome.Timeout
    package: azure-devops-extension-api
    summary: The test timed out
    numericValue: 5
  - name: Aborted
    uid: azure-devops-extension-api.TestOutcome.Aborted
    package: azure-devops-extension-api
    summary: >-
      Test was aborted. This was not caused by a user gesture, but rather by a
      framework decision.
    numericValue: 6
  - name: Blocked
    uid: azure-devops-extension-api.TestOutcome.Blocked
    package: azure-devops-extension-api
    summary: >-
      Test had it chance for been executed but was not, as
      ITestElement.IsRunnable == false.
    numericValue: 7
  - name: NotExecuted
    uid: azure-devops-extension-api.TestOutcome.NotExecuted
    package: azure-devops-extension-api
    summary: >-
      Test was not executed. This was caused by a user gesture - e.g. user hit
      stop button.
    numericValue: 8
  - name: Warning
    uid: azure-devops-extension-api.TestOutcome.Warning
    package: azure-devops-extension-api
    summary: To be used by Run level results. This is not a failure.
    numericValue: 9
  - name: Error
    uid: azure-devops-extension-api.TestOutcome.Error
    package: azure-devops-extension-api
    summary: There was a system error while we were trying to execute a test.
    numericValue: 10
  - name: NotApplicable
    uid: azure-devops-extension-api.TestOutcome.NotApplicable
    package: azure-devops-extension-api
    summary: Test is Not Applicable for execution.
    numericValue: 11
  - name: Paused
    uid: azure-devops-extension-api.TestOutcome.Paused
    package: azure-devops-extension-api
    summary: Test is paused.
    numericValue: 12
  - name: InProgress
    uid: azure-devops-extension-api.TestOutcome.InProgress
    package: azure-devops-extension-api
    summary: Test is currently executing. Added this for TCM charts
    numericValue: 13
  - name: MaxValue
    uid: azure-devops-extension-api.TestOutcome.MaxValue
    package: azure-devops-extension-api
    summary: ''
    numericValue: 14
  - name: NotImpacted
    uid: azure-devops-extension-api.TestOutcome.NotImpacted
    package: azure-devops-extension-api
    summary: Test is not impacted. Added fot TIA.
    numericValue: 14
